import portfolioImg from '../../images/strelka.svg';
import React from 'react';
import './Portfolio.css';

function Portfolio() {
    return (
        <section className="portfolio">
            <ul className="techs__info">
                <li className="techs__info-item">HTML</li>
                <img src={portfolioImg} alt="Стрелка" className="portfolio__img" />
                <li className="techs__info-item">CSS</li>
                <li className="techs__info-item">JS</li>
            </ul>
        </section>
    );
}

export default Portfolio;
